import React, { useEffect, useState } from "react";
import "./Result.css";

export default function Result({ searchCriteria }) {
  const [cars, setCars] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchCars = async () => {
      setLoading(true);
      let queryParams = new URLSearchParams(searchCriteria).toString();
      let url = `http://localhost:3002/cars${queryParams ? `?${queryParams}` : ""}`;

      try {
        const response = await fetch(url);
        const data = await response.json();
        if (data.message === "No data found") {
          setCars([]);
        } else {
          setCars(data);
        }
      } catch (error) {
        console.error("Error fetching cars:", error);
        setCars([]);
      } finally {
        setLoading(false);
      }
    };

    fetchCars();
  }, [searchCriteria]); 

  return (
    <div className="result-container">
      <h2 className="text-xl font-bold mb-4">Car List</h2>
      {loading ? (
        <p>Loading...</p>
      ) : cars.length === 0 ? (
        <p>No data found</p>
      ) : (
        <table className="result-table">
          <thead>
            <tr>
              <th>Make</th>
              <th>Model</th>
              <th>Year</th>
              <th>Description</th>
              <th>Odometer (km)</th>
              <th>Vehicle Condition</th>
              <th>Sale Location</th>
              <th>Sale Category</th>
              <th>Salvage Vehicle</th>
              <th>Sale Date</th>
              <th>Sale Price</th>
            </tr>
          </thead>
          <tbody>
            {cars.map((car, index) => (
              <tr key={index}>
                <td>{car.make}</td>
                <td>{car.model}</td>
                <td>{car.year}</td>
                <td>{car.description}</td>
                <td>{car.odometer}</td>
                <td>{car.car_condition}</td>
                <td>{car.states}</td>
                <td>{car.sales_category}</td>
                <td>{car.salvage_vehicle ? "Yes" : "No"}</td>
                <td>{car.sale_date}</td>
                <td>{car.sale_price}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}
